create table hierarchy
(
    hierarchyid   smallint    not null
        constraint hierarchy_pkey
            primary key,
    genusaccepted varchar(50) not null
        constraint hierarchy_genusaccepted_key
            unique,
    familyid      smallint    not null
        constraint hierarchy_familyid_fkey
            references family,
    categoryid    smallint    not null
        constraint hierarchy_categoryid_fkey
            references category
);

alter table hierarchy
    owner to postgres;

